set result to " Почта"

if application "Yandex" is running then
  tell application "Yandex"
    repeat with w in (every window)
      repeat with t in (every tab whose URL contains "mail.yandex-team.ru") of w
        set a to execute t javascript "(() => {
				const counters = [...document.querySelectorAll('.mail-NestedList-Item_current')];

				const s = counters.map(item => {
					const count = item.querySelector('.mail-NestedList-Item-Info-Extras');
					const name = item.querySelector('.mail-NestedList-Item-Name');

					if (!count) return null;

					return `(${name.innerText} ${count.innerText})`;
				}).filter(Boolean).join(' | ');

				return s;
			})();"
      end repeat
    end repeat

    if a is equal to missing value then
    set result to " Почта"
  else
  set result to " Почта " & a
  end if
  end tell
end if

set result to "Музыка"

if application "Yandex" is running then
	tell application "Yandex"
		repeat with w in (every window)
			repeat with t in (every tab whose URL contains "music.yandex.ru") of w
				set res to execute t javascript "(() => {
			const title = document.querySelector('.player-controls .d-link.deco-link.track__title');
			const artists = Array.from(document.querySelector('.player-controls .d-artists').children).filter(artist => artist.text).map(artist => artist.innerText).join(', ');
			const liked = document.querySelector('.player-controls .d-like.d-like_on') ? '♥️' : '';
			const disliked = document.querySelector('.player-controls .dislike.dislike_on') ? '🚫' : '';

			const playButton = document.querySelector('.player-controls .d-icon.d-icon_play').parentElement;

			const controll = playButton.classList.contains('player-controls__btn_pause')
				? '⏸'
				: '▶️';

			return `${artists} - ${title.innerText} ${[liked, disliked, controll].filter(Boolean).join(' ')}`;
	  })()"
			end repeat
		end repeat

		if res is equal to missing value then
			set result to "Музыка"
		else
			set result to res
		end if
	end tell
end if

